import {
    Button,
    Row,
    Table,
    Col,
    Modal,
    ModalHeader,
    ModalBody,
} from 'reactstrap'

const Dashboard = () => {
    const [employeeList, setEmployeeList] = useState([]);
    const handleAddEmployee = () =>{
        alert(`oke`);
    }


    useEffect(() => {
        const dataDummy = [
            {
                "name": "John",
                "age": 25
            },
            {
                "name": "Doe",
                "age": 26
            }
        ]

        setEmployeeList(dataDummy); // Test munculin di console browser [Inspect element]
    }, [])

    console.table(employeeList)
    return (
        <div className="dashboard-container" style={{margin: "0px 250px"}}>
            <h1>Employee List</h1>
            <br />
            <Button color="priamry" onClick={()=> handleAddEmployee()}>Add Employee</Button>
            
            Dashboard
        </div>
    )
}

export default Dashboard;
